import React from 'react';
import './Scroll.css';

const Scroll = (props) => {
	return (
		<div className="outerbox-scroll">
			<div style={{overflowY: 'scroll', height: `${props.height}`}}>
				{props.children}
			</div>
		</div>
	);
}

export default Scroll;
